import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 20, height: 20, viewBox: "0 0 20 20", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M4 4c0-1.1.9-2 2-2h8a2 2 0 012 2v12a2 2 0 01-2 2H6a2 2 0 01-2-2V4zm2 1a1 1 0 001 1h6a1 1 0 100-2H7a1 1 0 00-1 1zm0 10a1 1 0 001 1h6a1 1 0 100-2H7a1 1 0 00-1 1z", fill: primaryFill }));
};
const DocumentHeaderFooter20Filled = wrapIcon(rawSvg({}), 'DocumentHeaderFooter20Filled');
export default DocumentHeaderFooter20Filled;
